const API_BASE_URL = `http://localhost:3000`;

const headers = {
  "Content-Type": "application/json",
  Accepts: "application/json"
};

const getFunkos = () => {
  return (fetch(`${API_BASE_URL}/funkos`),
  {
    headers: headers
  }).then(res => res.json());
};

export default {
  getFunkos
};
